import '../styles/projects.css';

const Projects = () => {

    const project = [

        {
            id: 1,
            title: 'project one',
            image: '',
            cta: 'View project',
            link: ''
        },
        {
            id: 2,
            title: 'project two',
            image: '',
            cta: 'View project',
            link: ''
        },
        {
            id: 3,
            title: 'project three',
            image: '',
            cta: 'View project',
            link: ''
        }
    ]
    return (
        <section className='projects-container'>
            <p>Recent Work</p>
            {project.map(item => (

                <div className='project-card'>
                    <img src='' alt={item.title}/>
                    <p className='project-title'>{item.title}</p>
                    <p></p>
                    <button></button>
                </div>

            ))}
        </section>
    )
}

export default Projects;
